iscover sons were switched at birth | 60 Minutes Australia\",\"lengthSeconds\":\"851\",\"keywords\":[\"60 Minutes\",\"60 Minutes Australia\",\"Liz Hayes\",\"Charles Wooley\",\"Tara Brown\",\"Liam Bartlett\",\"Allison Langdon\",\"Ellen Fanning\",\"Karl Stefanovic\",\"Ray Martin\",\"Jana Wendt\",\"Jeff McMullen\",\"Jennifer Byrne\",\"Mike Munro\",\"Richard Carleton\",\"Tracey Curro\",\"Peter Harvey\",\"George Negus\",\"Ian Leslie\",\"Gerald Stone\",\"Sarah Abo\",\"Sandy Dawkins\",\"Megs Clinton Parker\",\"switched at birth\",\"south africa\",\"family\",\"issue\"],\"channelId\":\"UC0L1suV8pVgO4pCAIBNGx5w\",\"isOwnerViewing\":false,\"shortDescription\":\"(2012) Imagine making a decision - just one decision - that would haunt you for life and rip away everything you loved. Back in 1991, Sandy Dawkins and Megs Clinton Parker discovered that their two-year-old sons had been switched at birth, that they were each raising a child that was not biologically their own. They could have swapped the boys over then and there. But they didn't. For the next two decades, we watched as Sandy and Megs tried to make their bizarre relationship work. But, perhaps inevitably, it all fell apart. Now, 23 years later, there's been yet another and even more extraordinary twist in this bitter family saga.\\n\\nWATCH more of 60 Minutes Australia: https:\/\/www.60minutes.com.au \\nLIKE 60 Minutes Australia on Facebook: https:\/\/www.facebook.com\/60Minutes9 \\nFOLLOW 60 Minutes Australia on Twitter: https:\/\/twitter.com\/60Mins \\nFOLLOW 60 Minutes Australia on Instagram: https:\/\/www.instagram.com\/60minutes9\\n\\nFor forty years, 60 Minutes have been telling Australians the world’s greatest stories. Tales that changed history, our nation and our lives. Reporters Liz Hayes, Allison Langdon, Tara Brown, Charles Wooley, Liam Bartlett and Sarah Abo look past the headlines because there is always a bigger picture. Sundays are for 60 Minutes.\\n\\n#60MinutesAustralia\",\"isCrawlable\":true,\"thumbna
